INSERT INTO `products` (`id`, `image`, `image2`, `image3`, `image4`, `cat`, `title`, `description`, `price`) VALUES
(1, 'https://i.ibb.co/n7Ktrp3/71-H28d2-Pf-AL-SX679-PIbundle-12-Top-Right-0-0-AA679-SH20.jpg', 'https://i.ibb.co/6Jd4f8D/81i-C0-L4-0-L-SX679.jpg', 'https://i.ibb.co/rvGL4ZF/71pf-KOm47-CL-SX679.jpg', 'https://i.ibb.co/dB1bWcG/71br-g7-EBl-L-SX679.jpg', 'lose', 'Premier Protein Shake, Vanilla, 30g Protein, 1g Sugar, 24 Vitamins & Minerals, Nutrients to Support Immune Health 11.5 Fl Oz (Pack of 12)', 'Introducing our delectable Vanilla flavor that evokes the nostalgia of classic vanilla wafers. This delightful winner of the American Masters of Taste Gold Medal offers a host of benefits:\r\n\r\nA substantial 30g of protein to tame your mid-day hunger or aid in post-workout recovery. It includes all the essential amino acids for a well-rounded protein source.\r\n\r\nBoost your overall health with a rich blend of 24 essential vitamins and minerals. It fortifies your immune system with antioxidant vitamins C, D, and E, along with Zinc and Magnesium. Plus, it provides 50% of your daily calcium requirement to support strong bones.\r\n\r\nA guilt-free indulgence awaits you with this low-fat shake. It contains only 1g of sugar, 4g of carbs, and a mere 160 calories. It\'s also Keto-friendly for those watching their carb intake.\r\n\r\nExplore a variety of eleven (11) luscious, smooth, and creamy flavors. Choose from Chocolate, Vanilla, Caramel, Cookies & Cream, Cafe Latte, Strawberries & Cream, Peaches & Cream, Bananas & Cream, Cinnamon Roll, Chocolate Peanut Butter, and Cake Batter Delight.\r\n\r\nBid farewell to the hassle of preparing protein powder. Our ready-to-drink protein shake offers ultimate convenience, perfect for your busy lifestyle. It\'s a great on-the-go nourishment option that also pairs wonderfully with coffee, cereal, pancake recipes, or your favorite smoothie.\r\n\r\nPlease note that this product contains Milk and Soy.\r\n\r\nEmbrace the deliciousness and convenience of our Vanilla protein shake, and experience a classic taste with modern nutritional benefits.', '42.99'),
(2, 'https://i.ibb.co/kMyLwYD/71ai4-Gs-Flx-L-AC-SX679.jpg', 'https://i.ibb.co/C0CRvGJ/91-TLJYP-rz-L-AC-SX679.jpg', 'https://i.ibb.co/0JPJGzw/81e-B9-Cmxd-ZL-AC-SX679.jpg', 'https://i.ibb.co/2Mpwx4k/81-IOi-ABq-T6-L-AC-SX425.jpg', 'lose', 'Garden of Life Organic Vegan Vanilla Protein Powder 22g Complete Plant Based Raw Protein', 'WHAT’S THE SCOOP: Rebuild broken muscle and reduce recovery time with 22g of complete plant-based protein and 4g of a complete branched chain amino acid profile; But that’s not all—stay satiated longer with 5g of fiber in just 130 calories per serving\r\nDOWNRIGHT DELICIOUS: We’re taking a stand against chalky and bringing tasty back; Not only is Raw Organic Protein now easy to mix and silky smooth, but our Vanilla Flavor is downright delicious; Mix with water, blend in smoothies or add in to baked goods\r\nSHAKE IT UP: Raw Organic Protein has been shaken up to improved texture and mixability all while being sugar free; Organic peas, sprouted grains, seeds, legumes plus whole food vitamins and minerals deliver nutrients you need with 1g total net carbs\r\nDON’T TAKE THE HEAT: Made at low temperatures, Raw Organic Protein is anything but ordinary; Scoop up digestive enzymes like lipase, lactase and papain plus live probiotics including probiotic Bacillus subtilis DE111 for digestion and proper absorption\r\nEXTRAORDINARY STANDARD – Raw Organic Protein is not only downright delicious but also provides clean Third-Party Certified nutrition—Certified USDA Organic, Non-GMO Project Verified, Certified Vegan, Kosher, NSF Certified Gluten Free & Contents Certified\r\nNote: Products with electrical plugs are designed for use in the US. Outlets and voltage differ internationally and this product may require an adapter or converter for use in your destination. Please check compatibility before purchasing.', '79.99'),
(3, 'https://i.ibb.co/rdyc25P/71-XNW-Tfy5-L-AC-SX300-SY300-QL70-FMwebp.webp', 'https://i.ibb.co/7gh24fx/71-Hi7kt-Bu-HL-AC-SX679.jpg', 'https://i.ibb.co/tqv2DqF/71-AI-59-SLx-L-AC-SY879.jpg', 'https://i.ibb.co/rdyc25P/71-XNW-Tfy5-L-AC-SX300-SY300-QL70-FMwebp.webp', 'gain', 'Ultimate Nutrition Muscle Juice 2544, Lean Muscle Mass Classic ', 'MULTIPLE SOURCES OF PROTEIN: A protein blend that helps to supply 4 vital proteins - whey protein isolate, whey protein concentrate, calcium caseinate, and egg white albumen. This formula provides protein that helps to constantly feed and nourish your muscles.\r\nA WHOLESOME WEIGHT GAINER: Muscle Juice 2544 is a wholesome weight gainer that helps to supplement your regular workout. It has 55 grams of good quality protein per serving. It is a way to add the extra peptide–bonded and free-form amino acids to your nutrition program.\r\nLOOKING FOR MORE: This iso protein powder contains more ingredients such as Maltodextrin, Crystalline Fructose, Medium Chain Triglyceride or MCT, and Soy Lecithin. MCT allows for a slow and steady release of energy and helps to control serum cholesterol levels.\r\nOPTIMUM SOURCE OF AMINOS: This powder has over 26 grams of essential amino acids. Amino acids are one of the major building blocks of muscle development and are helpful for muscle tissue. This supplement helps to increase the anabolic environment and helps to stop muscle breakdown.\r\nCRAVE-WORTHY FLAVORS: 5 delicious flavors like Chocolate, Banana, Strawberry, Vanilla, and Cookies N Cream to make a delectable drink for you before or after the workout. Each shake mixes up effortlessly using just a glass and spoon and tastes consistently good, shake after shake.\r\nNote: Products with electrical plugs are designed for use in the US. Outlets and voltage differ internationally and this product may require an adapter or converter for use in your destination. Please check compatibility before purchasing.', '74.99'),
