(7, 'https://i.ibb.co/GsGFqMP/71ojv-WRd7-TL-AC-SX300-SY300-QL70-FMwebp.webp', 'https://i.ibb.co/3dZ79C0/81oub-MH7ef-L-AC-SX679.jpg', 'https://i.ibb.co/VDp4WW0/81-K9-SDv-Prb-L-AC-SX679.jpg', 'https://i.ibb.co/Z2sf661/81-WLd-Me-Wa3-L-AC-SX679.jpg', 'lose', 'Labrada Nutrition Lean Body Hi-Protein Shake, Strawberry, ', 'ALL-IN-ONE MRP - Forget other supplement pills and powders - you get it all in Lean Body: concentrated nutrition in one delicious, easy-to-make shake\r\nAWARD WINNING TASTE - Lean Body is a 5-time winner of the American Culinary Institute\'s Gold Medal Taste Award.\r\nLEAN BODY contains 40g of fast-release and slow-release proteins, to give you a sustained flow of vital amino acids for faster muscle growth and increases in strength.', '19.99'),
(8, 'https://i.ibb.co/dGpPydr/810k-Ch-Pjl-IL-AC-SX300-SY300-QL70-FMwebp.webp', 'https://i.ibb.co/LR16wt7/61-HAwiq-Gb-UL-AC-SX679.jpg', 'https://i.ibb.co/wWYmrg2/71-GVZFtos-NL-AC-SX679.jpg', 'https://i.ibb.co/C5nhp2D/615z-N4-QHG0-L-AC-SX679.jpg', 'lose', 'Garden of Life Dr. Formulated Keto Fit Weight Loss Shake - Vanilla Powder', 'NO MATH, JUST MIX: Doctor Perlmutter formulated our Keto Fit Weight Loss Shake with Clinically Studied ingredients and perfectly balanced macronutrients in ratios that FIT right in with your ketogenic or paleo diet—70% Fat, 20% Protein and 10% Carbs\r\nBURN FAT & FIGHT CRAVINGS: When it comes to weight loss shakes for women and men, you want proven ingredients; Fit provides 450mg of Clinically Studied Organic Svetol Green Coffee Bean extract, 300mg of Organic Ashwagandha and 65mg of Organic Coffeeberry\r\nGRASS FED & SO DELICIOUS: Sourcing matters! Our delightfully creamy Keto shake provides 16g of fat and 10g of protein from Grass Fed Butter powder & Whey Protein isolate; Dairy cows are humanely raised on family farms, happily grazing in lush pastures\r\nPOSSIBILITIES PLUS PROBIOTICS: Take your keto smoothie or fat bomb recipes to the next level with this a buttery smooth, low carb Vanilla shake—or simply mix it with water; We\'ve also added 1.5 Billion CFU of Probiotics for digestion\r\nTRULY CLEAN AND GREEN: Our passion for purity means you don\'t have to settle for less than Third-Party Certified Non-GMO, NSF Gluten Free, Keto, Paleo Friendly, Truly Grass Fed and Kosher; We are proudly B Corp and Carbon Neutral Certified\r\nNote: Products with electrical plugs are designed for use in the US. Outlets and voltage differ internationally and this product may require an adapter or converter for use in your destination. Please check compatibility before purchasing.', '29.99'),
(9, 'https://i.ibb.co/mt691kX/41-LZKmx4-FL-SY300-SX300.jpg', 'https://i.ibb.co/yPRn0sB/61w0kpd-Nrs-L-SX679.jpg', 'https://i.ibb.co/G3mbzFf/613-I-6ev-AHL-SX679.jpg', '', 'lose', 'GNC Lean Shake 25 - Girl Scout Thin Mints', 'GNC Total Lean Lean Shake 25 - Girl Scout Thin Mints: Packed With Protein, Fiber & Other Essential Nutrients Lean Shake 25 now available in Girl Scout Cookie inspired flavors! Officially licensed by Girl Scouts of the USA (GSUSA), a nonprofit. Girl Scouts\' licensing program powers life-changing experiences for girls. When hunger strikes, you can still satisfy it without compromising your weight loss goals.  Lean Shake 25 is a delicious meal replacement packed with protein, fiber and other\r\nWell balanced with high-quality protein & fiber\r\nFortified with 22 vitamins & minerals\r\nSuitable for a low-carb diet\r\nDelicious & healthy addition to your daily meal plan', '24.99'),
(10, 'https://i.ibb.co/pRSCw2D/719-NJav-LPL-AC-SY300-SX300.jpg', 'https://i.ibb.co/mFF8R0T/712hz-Qgz-FTL-AC-SX679.jpg', 'https://i.ibb.co/vHS5Vbd/713h-ABt4s3-L-AC-SX679.jpg', 'https://i.ibb.co/jgMwrvR/81-0b3-A1-Kf-L-AC-SX679.jpg', 'gain', 'Soy-Free Protein Bundle: 8LB Chocolate Naked Vegan Mass and Naked Creatine', 'ONLY FIVE INGREDIENTS: Pea Protein Powder, Organic Rice Protein Powder, Organic Maltodextrin (made from gluten free organic tapioca) Organic Coconut Sugar and Organic Cacao. Chocolate Naked Vegan Mass contains no artificial sweeteners, flavors, or colors and is GMO Free, Soy Free, Gluten Free, and Dairy Free with no rBGH or rBST.\r\nREAL CLEAN PROTEIN: Gain weight the right way with our lactose free weight gainer, which contains our premium Naked Pea and Naked Rice protein. Chocolate Naked Vegan Mass provides your body with the amino acids it needs to maintain protein synthesis and help you gain muscle when used with a weightlifting fitness routine.\r\nIDEAL FOR CHOCOLATE WEIGHT GAINER SHAKES: Our chocolate vegan mass gainer has a mild flavor profile so you can easily control what goes into your body and flavor as desired with fruit such as a banana or blueberries. For use by men or women that prefer a non dairy weight gainer.\r\nHIGHEST QUALITY: Naked Creatine is the highest grade creatine monohydrate supplement available.\r\nRAPID ABSORPTION: Pure creatine monohydrate allows for fast absorption which enhances gains, strength, and increases training capacity.', '56.78'),
